import React from 'react';
import {Div, Header, Img} from './posts';
import { Card } from 'antd';
import {HeartOutlined} from "@ant-design/icons";

const Posts = () => {
    return (
        <Div>
            <Header>username</Header>
            <Card
                hoverable
                style={{ width: 240 }}
                cover={<Img alt="example" src={process.env.PUBLIC_URL + '/Img/main-logo.png'} />}
            >
                <HeartOutlined />
                <h2>posts content</h2>
            </Card>
        </Div>
    );
};

export default Posts;
